import Logo from "./components/Logo";
import Paragraph from "./components/Paragraph";
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Logo />

        <Paragraph />

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
